import { useState, useEffect } from "react";

function useStats() {
  const [stats, setStats] = useState();

  useEffect(async () => {
    console.log('fetching data');
    fetch('https://covid19.mathdro.id/api').then((response) => response.json);
  }, []);
}

export default function IndexPage() {
  return <p>hey</p>;
}
